export default function Listing(props) {
    return (
    <div className="dataList">
      <h2>List</h2>
        {props.grades.map(entry => (
            <ul className="list">
                <li className>{entry.name}</li>
                <li>{entry.grade}</li>
                <li>{entry.grad.toString()}</li>
            </ul>
        ))}
    </div>
  );
}
